function exibirImagem() {
  var codigo = document.getElementById('tombo').value

  if (codigo in imagens) {
    var img = document.getElementById('imagem');
    img.src = imagens[codigo];
    img.style.display = "block";
  } else {
    alert("Digite um nmero de tombo entre 7456 at 8076");
  
  }

}

var codigo = window.document.getElementById('tombo')
codigo.addEventListener("keydown", function(event) {
    if (event.key === "Enter") {
        exibirImagem()
    }
})

